import React from 'react';

const Footer = () => {
  return (
    <div className='py-4 text-center bg-gray-400'>
      <br />
      MyDailyStatus é um projeto criado ddurante o Fullstack Lab do DevPleno.
      implementado por: <a href='https:/linkedin.com/in/brunocrodriguessouza'>Bruno Cícero Rodrigues de Souza</a>
    </div>
  )
}

export default Footer;
